import Header from "./components/UI/Header";
import MainSlider from "./components/mainSlider/MainSlider";
import News from "./components/news/News";
const App = () => {
  const categories = [
    "პოლიტიკა",
    "საზოგადოება",
    "სამართალი",
    "ბიზნესი & ეკონომიკა",
    "ეკონომიკა",
    "რელიგია",
  ];

  return (
    <div>
      <Header
        className="header"
        companyName="Company Name "
        categories={categories}
      />
      <div>
        {" "}
        <MainSlider />
        <News />
      </div>
      {/* Other components */}
    </div>
  );
};

export default App;
